/* eslint-disable react/prop-types */
// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import ArgonAvatar from "components/ArgonAvatar";
import ArgonBadge from "components/ArgonBadge";

// Images
import school1 from "assets/images/school-1.png";
import school2 from "assets/images/school-2.png";
import school3 from "assets/images/school-3.jpg";

function Author({ image, name, email }) {
  return (
    <ArgonBox display="flex" alignItems="center" px={1} py={0.5}>
      <ArgonBox mr={2}>
        <ArgonAvatar src={image} alt={name} size="sm" variant="rounded" />
      </ArgonBox>
      <ArgonBox display="flex" flexDirection="column">
        <ArgonTypography variant="button" fontWeight="medium">
          {name}
        </ArgonTypography>
        <ArgonTypography variant="caption" color="secondary">
          {email}
        </ArgonTypography>
      </ArgonBox>
    </ArgonBox>
  );
}


function Function({ job, org }) {
  return (
    <ArgonBox display="flex" flexDirection="column">
      <ArgonTypography variant="caption" fontWeight="medium" color="text">
        {job}
      </ArgonTypography>
      <ArgonTypography variant="caption" color="secondary">
        {org}
      </ArgonTypography>
    </ArgonBox>
  );
}

const authorsTableData = {
  columns: [
    { name: "school", align: "left" },
    { name: "type", align: "left" },
    { name: "license status", align: "center" },
    { name: "established", align: "center" },
    { name: "lga", align: "center" },
    { name: "action", align: "center" },
  ],

  rows: [
    {
      school: <Author image={school1} name="Government Secondary School Jos" email="gssjos@edu.ng" />,
      type: <Function job="Public" org="Secondary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="renewed" color="success" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          1972
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Jos North
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
    {
      school: <Author image={school2} name="St. Louis College Jos" email="stlouisjos@edu.ng" />,
      type: <Function job="Private" org="Secondary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="renewed" color="success" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          1960
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Jos North
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
    {
      school: <Author image={school3} name="Federal Government College Jos" email="fgcjos@edu.ng" />,
      type: <Function job="Federal" org="Secondary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="expired" color="error" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          1973
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Jos South
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
    {
      school: <Author image={school1} name="Gss gindiri" email="gssgindiri@edu.ng" />,
      type: <Function job="Public" org="Secondary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="renewed" color="success" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          1978
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Mangu
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
    {
      school: <Author image={school2} name="University of Jos" email="unijos@edu.ng" />,
      type: <Function job="Federal" org="Tertiary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="renewed" color="success" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          1975
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Jos North
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
    {
      school: <Author image={school3} name="Plateau State University Bokkos" email="plasu@edu.ng" />,
      type: <Function job="State" org="Tertiary" />,
      "license status": (
        <ArgonBadge variant="gradient" badgeContent="expired" color="error" size="xs" container />
      ),
      established: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          2005
        </ArgonTypography>
      ),
      lga: (
        <ArgonTypography variant="caption" color="secondary" fontWeight="medium">
          Bokkos
        </ArgonTypography>
      ),
      action: (
        <ArgonTypography
          component="a"
          href="#"
          variant="caption"
          color="secondary"
          fontWeight="medium"
        >
          Edit
        </ArgonTypography>
      ),
    },
  ],
};

export default authorsTableData;
